import {
  Collapsible,
  CollapsibleContent,
  CollapsibleTrigger,
} from "@/registry/default/ui/collapsible";

export default function CollapsibleDemo() {
  return (
    <Collapsible>
      <CollapsibleTrigger></CollapsibleTrigger>
      <CollapsibleContent></CollapsibleContent>
    </Collapsible>
  );
}
